import Vegetables from './Vegetables';
import Products from './Products';
import Form from "./Form";



function App() {
  return (

    <Router>
    <Navbar />
    <Switch>
          <Route path="/">
            <Form />
          </Route>
          <Route path="/fruits">
            <Fruits />
          </Route>
          <Route path="/">
            <Home />
          </Route>
        </Switch>
  </Router>

  );
}

export default App;
